import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import {GlobalStyle} from './style.js';

const Apps=(
    <GlobalStyle>
        <App/>
    </GlobalStyle>
)


ReactDOM.render(Apps, document.getElementById('root'));
